Content:
Hey guys, has anyone had `get_caller_address` problems in devnet ? I feel like it's returning address 0 when it shouldn't so I made this small contract to test it

```%lang starknet

from starkware.cairo.common.cairo_builtins import HashBuiltin

from starkware.starknet.common.syscalls import (get_caller_address)

@storage_var
func caller_addr() -> (res: felt) {
}


@external
func fn_to_be_called{syscall_ptr: felt*, pedersen_ptr: HashBuiltin*, range_check_ptr: felt}() {
    let (caller) = get_caller_address();
    caller_addr.write(caller);    

    return ();
}

@view
func get_caller_addr{syscall_ptr: felt*, pedersen_ptr: HashBuiltin*, range_check_ptr: felt}() -> (caller_addr: felt) {
    let (caller) = caller_addr.read();

    return (caller_addr=caller);
}```

and indeed `get_caller_addr` return address 0 after I called `fn_to_be_called` in the devnet. This is causing some problems in more complex contracts of course. Is it just me ?

POST /postman/send_message_to_l2 returns transaction_hash as float:
```
data: { transaction_hash: 2.939693640971957e+75 }
```
which makes it unusable.
@Mikolaj | SpaceShard

is `get_nonce` not implemented for the default predeployed accounts? I started devnet (v0.4.6) with `starknet-devnet --seed 0` and I'm using starknetjs to try to see what the nonce is for the first account (0x7e00d496e324876bbc8531f2d9a82bf154d1a04a50218ee74cdd372f75a551a), but its giving me `StarknetErrorCode.ENTRY_POINT_NOT_FOUND_IN_CONTRACT`:

```
await account.callContract(
    {
        contractAddress: "0x7e00d496e324876bbc8531f2d9a82bf154d1a04a50218ee74cdd372f75a551a",
        entrypoint: "get_nonce",
    },
    { blockIdentifier: "latest" }
);
```
